import React, { useState } from 'react';
import { IonCard, IonCardHeader, IonCardSubtitle, IonCardTitle, IonCardContent, IonItem, IonIcon, IonLabel, IonButton } from '@ionic/react';
import './PermissionComponent.css';


const PermissionComponent: React.FC = () => {
  //const [url, setURL] = useState("http://facebook.github.io/react/");

  return (
    <div className="permission-container">
      <IonCard className="card-bg">
        <IonItem href="#" className="ion-activated card-bg">
          <IonLabel>Card Link Item 1 activated</IonLabel>
        </IonItem>

        <IonItem className="card-bg" href="#">
          <IonLabel>Card Link Item 2</IonLabel>
        </IonItem>

        <IonItem className="ion-activated">
          <IonLabel>Card Button Item 1 activated</IonLabel>
        </IonItem>

        <IonItem>
          <IonLabel>Card Button Item 2</IonLabel>
        </IonItem>
      </IonCard>


    </div>
  );


}

export default PermissionComponent;
